description:
Wrapper for creating xlsx files with DocumentFormat.OpenXml 

usage: 
var excel = new Document(); 

//Get the first sheet 
var sheet1 = excel.GetSheets().First() 
//Change sheet name 
sheet1.Name = "My first sheet"; 

//Write some data 
sheet1.WriteToCell(1, 1, "Test 1"); 

//Create another sheet 
var sheet2 = excel.AddSheet(new Sheet("My second sheet")); 

//Write some data 
sheet2.WriteToCell(1, 1, "Test 2"); 

//Save to file, or stream... 
excel.Save("myFile.xlsx");

Particular favourites are;
PrivateWrapper - to allow access to the private methods of a "wrapped" object - via dynamic.
Creator - To create repeatable but random data for "filled" classes to test - various properties available to control the range of filling.

